import React from "react";
import ProjectCard from "../components/ProjectCard";
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';
import Header from "../components/Header";
import "./Projects.css"
import Content from "../components/Content";
import simplyWeather from "../imgs/simplyweather.svg"

export default function Projects() {

    return (
        <div id="projects">
            <Header title={"Projects"} caption={"These are some of the various projects I've made through the years. Some were completed in school, though most were done outside of class as personal projects."} />
        </div>
    )
}
